import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {
  return (
    <>
      <div className="setStyle">
        <p> Sorry, this page doesn't exist </p>
        <NavLink to="/"> Go Back </NavLink>
      </div>
    </>
  );
};

export default Home;
